def normalize(val):

    if float(val) >= 1-eps:
        val='1'
    elif float(val) <= 0+eps:
        val = '0'
    else:
        val = val.lstrip('0').rstrip('0')

    return val

def processbox(box):
    #box == [LabelName, Score, YMin, XMin, YMax, XMax]

    [LabelName, Score, YMin, XMin, YMax, XMax] = box

    Score=str(float(Score)*0.999+0.001)

    Score = normalize(Score)
    YMin = normalize(YMin)
    XMin = normalize(XMin)
    YMax = normalize(YMax)
    XMax = normalize(XMax)

    if float(Score)>0.02:
        Score = Score[:5]
        YMin = YMin[:4]
        XMin = XMin[:4]
